import React from "react";

function Nav() {
  return (
    <div className="dropdown-menu">
      <h6 className="dropdown-header">Dropdown header</h6>
      <a className="dropdown-item" href="#">
        Action
      </a>
      <a className="dropdown-item" href="#">
        Another action
      </a>
    </div>
  );
}

export default Nav;
